import { Grid, makeStyles } from '@material-ui/core'
import React from 'react'
import InputTextField from '../../_components/_inputs/InputTextField'
import { IMenuLayoutConfig } from './interfaces/IMenueLayoutConfig'

interface IProps{
    menuConfig: IMenuLayoutConfig
}

const styles = makeStyles((theme) => ({
    root:{
        display: 'flex',
        justifyContent: 'space-around',
        backgroundColor: 'lightgray',
        height: '8vh'
    }
}))

const MenuFilter: React.FC<IProps> = (props) => {

    const {menuConfig} = props
    const useStyle = styles()

    return (
        <Grid 
            container 
            className={useStyle.root}>
           <Grid 
                item>
                <InputTextField label='Filter' value={''}  />
            </Grid >
            <Grid 
                item>
                 <InputTextField label='MenuType' value={''} hasSelect={true} />
            </Grid >
        </Grid>
    )
}

export default MenuFilter
